import React from 'react'
import { NavLink } from 'react-router-dom'
const Home = () => {
	return (
        <div className="Link">
	<table>
                <td><NavLink to={`/Online`}> Online Shop</NavLink></td>
        </table>		
                        
        </div>
       )
}
export default Home
